import React, { Component } from "react";
import styled from 'styled-components';

const ImgStyled = styled.img`
    width: 100px;
    height: 100px;
`;

class Logo extends Component {
    render() {
        return (
            <a href="/#" >
                <ImgStyled
                    src="/img/logo.jpg"
                    alt="Print on balls"
                />
            </a>
        )
    }
}

export default Logo;
